import "assets/css/screens/page.css";
import "assets/css/screens/cut.css";
import { useState } from "react";
import CutHeader from "./CutHeader";
import CutCanvas from "./CutCanvas";
import PageSidebar from "../Page/PageSidebar";
// CutManagement 컨테이너
// 컷 관리: 현재 페이지, 줌 레벨, 컷 편집 모드

// components/screens/CutManagement/index.jsx
export default function CutManagement() {
  const [currentPageId, setCurrentPageId] = useState("page-0001");
  const [zoomLevel, setZoomLevel] = useState(1);

  return (
    <div className="cut-management">
      <PageSidebar currentPageId={currentPageId} />
      <div className="workspace">
        <CutHeader />
        <CutCanvas pageId={currentPageId} zoom={zoomLevel} />
      </div>
    </div>
  );
}
